import arrow from '../assets/arrow.png';
import firstimage from '../assets/first_project.jpg';
import firstprojectvideo from '../assets/first_project_video.gif';

function Projects() {
  const itemElements = document.querySelectorAll('.item');

  itemElements.forEach((item) => {
    item.addEventListener('mouseenter', () => {
      item.classList.add('item--flipped');

      // // Устанавливаем ширину элемента .item равной ширине .back
      // const backWidth = item.querySelector('.item-inner__back').offsetWidth;
      // item.style.width = `${backWidth}px`;
    });

    item.addEventListener('mouseleave', () => {
      item.classList.remove('flipped');

      // Возвращаем исходную ширину элемента .item
      // item.style.width = '';
    });
  });

  return (
    <div className="projects">
      <div className="container">
        <div className="title">
          <div className="heading">
            <p>Projects</p>
          </div>
        </div>
        <div className="content">
          <div className="content__title">
            <p>Take a look at some of my projects</p>
          </div>
          <div className="content__slider">
            <div className="scroll_btn_block">
              <img className="arrow" src={arrow} alt="arrow_image"></img>
              <div className="scroll">
                <p>Scroll</p>
              </div>
            </div>
            <div className="items_row">
              <div className="item">
                <div className="item-inner">
                  <div className="item-inner__front">
                    <img src={firstimage} alt="First project image" />
                    <div className="text">
                      <p className="text__head">WEBSITE</p>
                      <p className="text__title">YOUR STYLISH ONTARIO</p>
                      <p className="text__technologies">React</p>
                    </div>
                  </div>
                  <div className="item-inner__back">
                    <img src={firstprojectvideo} alt="First project video" />
                    <div className="text">
                      <p className="text__title">About</p>
                      <p className="text__about">
                        Full-fledged React web app for a clothing shop. Browse, filter, and search
                        for items effortlessly. Add to cart, stay updated with client block news,
                        and enjoy seamless navigation.
                      </p>
                    </div>
                    <div className="buttons">
                      <button className="btn btn--first">Website</button>
                      <button className="btn btn--first">Github</button>
                    </div>
                  </div>
                </div>
              </div>
              <div className="item">
                <div className="item-inner">
                  <div className="item-inner__front">
                    <img src={firstimage} alt="First project image" />
                    <div className="text">
                      <p className="text__head">WEBSITE</p>
                      <p className="text__title">YOUR STYLISH ONTARIO</p>
                      <p className="text__technologies">React</p>
                    </div>
                  </div>
                  <div className="item-inner__back">
                    <img src={firstprojectvideo} alt="First project video" />
                    <div className="text">
                      <p className="text__title">About</p>
                      <p className="text__about">
                        Full-fledged React web app for a clothing shop. Browse, filter, and search
                        for items effortlessly. Add to cart, stay updated with client block news,
                        and enjoy seamless navigation.
                      </p>
                    </div>
                    <div className="buttons">
                      <button className="btn btn--first">Website</button>
                      <button className="btn btn--first">Github</button>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Projects;
